import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";


export default function App() {
  return (
    <div className="App" style={{
      backgroundColor: "black"}}>
      <h1 style={{color:"white"}}>Hearthstone cards</h1>

      <body>
        <p>hello world</p>
      </body>
      <button></button>
      <button></button>
      <Router>
        <Routes>
            <Route path="/home" children = {123}> home </Route>
          {/* <Route exact path="/" children={1} />
          <Route path="/home" children={1} /> */}
        </Routes>
      </Router>
    </div>
  );
}
